export const baseUrl = () => {
    if (IS_PROD) return "https://miles.pashabank.digital/v1/thy";
    if (IS_DEV) return "https://devmiles.pashabank.digital/v1/thy";
    if (IS_LOCAL) return "http://localhost/api";
};

export const fetcher = (url: string) => fetch(url).then((res) => res.json());

